export default function AbaSelector({ abas, abaSelecionada, mudarAba }) {
  return (
    <div className="flex space-x-4 border-b-2 mb-6">
      {Object.keys(abas).map((aba) => (
        <button
          key={aba}
          onClick={() => mudarAba(aba)}
          className={`pb-2 ${
            abaSelecionada === aba
              ? "border-b-4 border-blue-600 text-blue-600"
              : "text-gray-600"
          }`}
        >
          {aba}
        </button>
      ))}
    </div>
  );
}
